  01> ARMISTEAD, David James
  b 23.01.1973
  Address: Hopelands Road, RD 1, Woodville.
  David attended Hadlow Preparatory School and Rathkeale College in Masterton and later worked on
  large sheep stations in the North and South Islands. He spent a year overseas working in gold
  mines in Western Australia and is now back on the family farm near Woodville.
  02> ARMISTEAD, Mary Jane
  b 27.09.1974
  Address: Bluff Road, RD 1, Woodville.
  Mary attended St Matthew's Collegiate School in Masterton then worked in Wellington and Taupo
  before studying floristry at the Bay of Plenty Polytechnic.
  02> BUNNY, Thomas William m on 09.11.1963 to LEWIS, Diana Katherine
  b 17.10.1938
  b 09.03.1940
  Thomas b. and m, at Masterton. Diana, d/o Guy Lewis and Elsie Speedy, b. in England. Address: Te Roto,
  RD 11, Masterton.
  Thomas is a farmer, a member and Chairman of the Trinity Schools Trust Board (1977-89) and a Justice of
  the Peace.
  Diana is keen on all aspects of country gardening.
